    <div>
        <p>Hello Next.js</p>
        <Link href="/about" title="About Us">
            <a>About Page</a>
        </Link>
        <Layout>
            <div className="ui basic segment">
                <div className="ui three column stackable centered aligned grid">
                    {people.map(person => (
                        <Card {...person} />
                    ))}
                </div>
            </div>
        </Layout>
    </div>
);

export default Index;
